const {createStore, applyMiddleware} = require('redux')
import thunk from 'redux-thunk'
const {reducer} = require('../reducers/index.js')

const store = createStore(reducer, applyMiddleware(thunk))

console.log('SSAAA', store)

export default {
    store
}
